import React from "react";
import {
  SideBar,
  SideBarWrapper,
  SideBarMenu,
  SideBarTitle,
  SideBarListItem,
  SideBarList,
  Logo,
  UpperLogo,
} from "./SideBarElements.js";
import {
  AiOutlineDashboard,
  AiOutlineSetting,
  AiOutlineDatabase,
} from "react-icons/ai";
import Tile from "./tile/js";

import { BiMessageSquareDetail } from "react-icons/bi";
import { RiAccountCircleLine } from "react-icons/ri";

import img from "../../../images/svg-9.svg";

const SideBarDD = ({ lightBg }) => {
  return (
    <>
      <SideBar>
        <SideBarWrapper>
          <SideBarMenu>
            <UpperLogo src={img} alt="profilPic"></UpperLogo>
            <SideBarTitle>DATA</SideBarTitle>
            <Tile to="/dashboard/datasets">
              DATASET
              <AiOutlineDatabase />
            </Tile>
            <SideBarTitle>PAGES</SideBarTitle>
            <SideBarList>
              <Tile to="/dashboard/main">
                DASHBOARD
                <AiOutlineDashboard />
              </Tile>
              <Tile to="/dashboard/settings">
                SETTINGS <AiOutlineSetting />
              </Tile>
              <Tile to="/dashboard/messages">
                MESSAGES
                <BiMessageSquareDetail />
              </Tile>
              <Tile lightBg={lightBg} to="/dashboard/account">
                ACCOUNT
                <RiAccountCircleLine />
              </Tile>
            </SideBarList>
          </SideBarMenu>
          <Logo>TECH_PUNCH</Logo>
        </SideBarWrapper>
      </SideBar>
    </>
  );
};

export default SideBarDD;
